import './Content.css'
import img from './ham.png'
import {content} from './info.js'

const Content = ({img, heading, para}) => {

    console.log(content);
    return(
        <section className="content">
            <article className="article">
                <img src={img} alt="img" ></img>
                <div className="text">
                    <h1>{heading}</h1>
                    <p>{para}</p>
                </div>
            </article>
        </section>
    );
}

export default Content;
